events.script:
main()
{
  dpConnect(&quot;modConnectRSU&quot;,
            &quot;System1:_Mod_Plc_6.ConnState:_online.._value&quot;,
            &quot;System1:_Mod_Plc_6_2.ConnState:_online.._value&quot;);
}

void modConnectRSU(string dpe1, int stateHost1,
                   string dpe2, int stateHost2) {
  if (stateHost1 != 1 &amp;&amp; stateHost2 != 1)
  {
    linkRSU = false;
    ModConnRSU.visible = true;
  } else {
    linkRSU = true;
    ModConnRSU.visible = false;
  }
  if (!linkRSU) {
    this.backCol = &quot;WF_Border&quot;;
  } else {
    this.backCol = &quot;White&quot;;
  }
}

main()
{
  dpConnect(&quot;updateState&quot;, &quot;System1:3A07_GSU.CMD.PKO1Close&quot;);
}

void updateState(string dpe, bool val)
{
  if (val)
  {
    block1.backCol(&quot;sd_not_okay&quot;);
  }
  else
  {
    block1.backCol(&quot;sd_valve_closed&quot;);
  }
}

